import React from 'react';
import 'App.css';
import { Routes, Route, Outlet, Link } from "react-router-dom";
const Sidebar = React.lazy(() => import('component/Sidebar'));
const Login = React.lazy(() => import('container/Login'));
const Protected = React.lazy(() => import('container/Protected'));

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={null}>
          <Route index element={<Protected />} />
          <Route
            path="protected"
            element={
              <React.Suspense fallback={<>...</>}>
                <Protected />
              </React.Suspense>
            }
          />
          <Route
            path="login"
            element={
              <React.Suspense fallback={<>...</>}>
                <Login />
              </React.Suspense>
            }
          />
        </Route>
      </Routes>
    </div>
  );
}

function Layout() {
  return (
    <div>
      <Sidebar/>
      <main style={{ marginLeft: '25%' }}>
        <Outlet />
      </main>
    </div>
  );
}

export default App;
